import React, { useState, useEffect } from 'react';

function Data() {
  const [data, setData] = useState({});
  const [loading, setLoading] = useState(true);
  const [selectedBreed, setSelectedBreed] = useState(null);

  useEffect(() => {
    // Replace the API URL with the dog breed API
    fetch('')
      .then(response => response.json())
      .then(data => {
        setData(data.message);
        setLoading(false);
      })
      .catch(error => {
        console.error(error);
        setLoading(false);
      });
  }, []);

  const handleBreedClick = breed => {
    // Set the selected breed when a breed is clicked
    setSelectedBreed(breed);
  };

  return (
    <div>
      <h1>Dog Breeds:</h1>
      {loading ? (
        <p>Loading data...</p>
      ) : (
        <div>
          <ul>
            {Object.keys(data).map(breed => (
              <li key={breed} onClick={() => handleBreedClick(breed)}>
                {breed}
              </li>
            ))}
          </ul>
          {selectedBreed && (
            <div>
              <h2>Selected Breed: {selectedBreed}</h2>
              {/* You can fetch and display more details about the selected breed here */}
            </div>
          )}
        </div>
      )}
    </div>
  );
}

export default Data;
